        public int[] AsteroidCollision(int[] asteroids)
        {
            var leftDanger = new List<int>();
            var dangerIndex = -1;
            var res = new List<int>();

            var i = 0;
            while (i < asteroids.Length)
            {
                var ast = asteroids[i];
                if (ast < 0)
                {
                    if (dangerIndex == i)
                    {
                        i++;
                    }
                    else
                    {
                        while (true)
                        {
                            if (dangerIndex == i)
                            {
                                i++;
                                break;
                            }

                            if (leftDanger[lastIndex] > -ast)
                            {
                                asteroids[i]
                                break;
                            }

                            if (leftDanger[lastIndex] < -a)
                            {
                                leftDanger.RemoveAt(lastIndex);
                                lastIndex--;
                                continue;
                            }

                            if (leftDanger[lastIndex] == -a)
                            {
                                leftDanger.RemoveAt(lastIndex);
                                break;
                            }
                        }
                    }
                }
                else
                {
                    leftDanger.Add(a);
                }
            }

            res.AddRange(leftDanger);
            return res.ToArray();
        }
    }
